var rate = function(rateInputObj) {

	this.evaluateByObj = function(dimObj) {
		result = this.evaluate(dimObj);
		if (!result || result.total <= 0 || !rateInputObj.baseRate.total
				|| rateInputObj.baseRate.total <= 0) {
			// warn(rateInputObj.rateId+':FinalTotalAmt='+result.total);
			// warn(rateInputObj.rateId+':Dimensions: '+JSON.stringify(dimObj));
			return 9999999;
		}
		return parseFloat(result.total);
	};

	this.evaluate = function(dimObj) {
		this.evaluateBaseRate(dimObj);
		this.evaluateAccessorials(dimObj);
