					}
				}
			}
			rateInputObj.amount = parseFloat(amount);
			totalAmt = bandAmt;
		}

		if (!supportedBasis) {
			switch (inputObj.basis) {
			case '/container':
			case '/CBM':
			case '/WM':
			case '/kg':
			case '/lb':
			case '/ton':
			case '/MI':
			case '/KM':
				rateInputObj.baseRate.supportedBasis = true;
				supportedBasis = true;
			}
		}

		if (!supportedBasis) {
			totalAmt = inputObj.amount;
		}

		if (inputObj.minAmount) {
			totalAmt = totalAmt < inputObj.minAmount ? inputObj.minAmount
					: totalAmt;
		}
		if (inputObj.maxAmount) {
			totalAmt = totalAmt > inputObj.maxAmount ? inputObj.maxAmount
					: totalAmt;
		}

		rateInputObj.baseRate.supportedBasis = supportedBasis;
		rateInputObj.baseRate.total = parseFloat(totalAmt);
	};

	this.getEffectiveDistance = function(dimObj) {
		distance = 0.0;
		for (i = 0; i < dimObj.stopOffs.length - 1; i++) {
			origStop = dimObj.stopOffs[i].stop;
			if (origStop.indexOf('__') > 0) {
				origStop = origStop.slice(0, origStop.indexOf('__'));
			}
			destStop = dimObj.stopOffs[i + 1].stop;
			if (destStop.indexOf('__') > 0) {
				destStop = destStop.slice(0, destStop.indexOf('__'));
			}
			if (origStop == destStop) {
				distance = distance + 0.01;
				continue;
			}
			if (!distanceMatrix[origStop]
					|| !distanceMatrix[origStop][destStop]) {
				if (rateInputObj.distance) {
					return rateInputObj.distance;
				} else {
					return 9999999;
				}
			}
			distance = distance + distanceMatrix[origStop][destStop];
		}
		return distance;
	};

	this.evaluateRateBands = function(totalDim, rateAmount, ConvRate) {
		totalBandAmt = 0.0;
		if (rateInputObj.rateBands && rateInputObj.rateBands.length > 0) {
			for (i = 0; i < rateInputObj.rateBands.length; i++) {
				if ((totalDim >= rateInputObj.rateBands[i].lowerbreak && !rateInputObj.rateBands[i].upperbreak)
						|| (totalDim >= rateInputObj.rateBands[i].lowerbreak && totalDim <= rateInputObj.rateBands[i].upperbreak)) {
					totalBandAmt = (rateInputObj.baseRate.basis === '/FLAT') ? rateInputObj.rateBands[i].amount
							: (rateInputObj.rateBands[i].amount * totalDim * ConvRate);
					break;
				}
			}
			if (totalBandAmt == 0 && rateInputObj.baseRate) {
				totalBandAmt = rateInputObj.baseRate.basis === '/kg' ? (rateInputObj.baseRate.amount
						* totalDim * ConvRate)
						: rateInputObj.baseRate.amount;
			}
		} else {
			totalBandAmt = (rateInputObj.baseRate.basis === '/FLAT') ? rateAmount
					: rateAmount * totalDim * ConvRate;
		}
		return parseFloat(totalBandAmt);
	};

	this.evaluateAccessorials = function(dimObj) {
		if (rateInputObj.accessorials) {
			for (var i = 0; i < rateInputObj.accessorials.length; i++) {
				if (rateInputObj.accessorials[i]) {
					accObj = rateInputObj.accessorials[i];

					totalAmt = 0;
					if (accObj.basis === '/container') {
						if (rateInputObj.baseRate.equipmentType
								&& dimObj.dims[rateInputObj.baseRate.equipmentType]) {
							totalAmt = accObj.amount
									* dimObj.dims[rateInputObj.baseRate.equipmentType];
						} else {
							rateInputObj.accessorials[i].total = parseFloat(totalAmt);
							continue;
						}
					}

					if (accObj.basis === '%') {
						netfreightcostelems = rateInputObj.netfreightcostelems;
						if (netfreightcostelems
								&& netfreightcostelems.length > 0) {
							totalSurchargeAmount = 0;
							for (var j = 0; j < netfreightcostelems.length; j++) {
								netFreightSurcharge = netfreightcostelems[j];
								surchargeAmount = this.getSurchargeAmount(
										dimObj, netFreightSurcharge);
								totalSurchargeAmount = totalSurchargeAmount
										+ surchargeAmount;
							}

							baseRate = rateInputObj.baseRate.total;
							totalAmt = ((baseRate + totalSurchargeAmount) * accObj.amount) / 100;
						} else {
							baseRate = rateInputObj.baseRate.total;
							totalAmt = (baseRate * accObj.amount) / 100;
						}
					}

					if (accObj.basis === '/delivery'
							|| accObj.basis === '/entry'
							|| accObj.basis === '/shipment') {
						totalAmt = accObj.amount;
					}

					if (accObj.basis === '/package'
							|| accObj.basis === '/pallet'
							|| accObj.basis === '/unit'
							|| accObj.basis === '/carton'
							|| accObj.basis === '/LNM'
							|| accObj.basis === '/SQM'
							|| accObj.basis === '/MSF'
							|| accObj.basis === '/MBF'
							|| accObj.basis === '/LDM') {
						if (dimObj.dims.genericQty
								&& dimObj.dims.genericQtyUnit
								&& (dimObj.dims.genericQtyUnit === accObj.basis)) {
							totalAmt = accObj.amount * dimObj.dims.genericQty;
						} else if (dimObj.dims[accObj.basis]) {
							totalAmt = accObj.amount
									* dimObj.dims[accObj.basis];
						}
					}

					if (dimObj.dims.wtInKG && accObj.wtConvRate) {
						weight = dimObj.dims.wtInKG;

						// GTN-25018 : Chargeable Weight scenario.
						if (accObj.calculatedWeightBasis
								&& accObj.calculatedWeightBasis === 'Chargeable Weight') {
							dimFactor = rateInputObj.dimFactor;
							dimFactorConv = rateInputObj.dimFactorConv;

							volumetricWeight = 0.0;
							if (dimFactor > 0 && dimFactorConv
									&& dimObj.dims.volInCBM) {
								if (dimFactorConv === 'cm/kg') {
									volumetricWeight = (dimObj.dims.volInCBM * 1000000)
											/ dimFactor;
								} else if (dimFactorConv === 'in/lb') {
									volumetricWeight = (dimObj.dims.volInCBM * 61024)
											/ dimFactor;
									volumetricWeight = volumetricWeight * 0.45359237;
								}
							}
							weight = (weight * accObj.wtConvRate) > (volumetricWeight * accObj.wtConvRate) ? weight
									: volumetricWeight;
						}

						if (accObj.minWeight) {
							weight = weight < accObj.minWeight ? accObj.minWeight
									: weight;
						}
						totalAmt = accObj.amount * weight * accObj.wtConvRate;
					}
					if (dimObj.dims.volInCBM && accObj.volConvRate) {
						volume = dimObj.dims.volInCBM;
						if (accObj.minVolume) {
							volume = volume < accObj.minVolume ? accObj.minVolume
									: volume;
						}
						totalAmt = accObj.amount * volume * accObj.volConvRate;
					}

					if ((dimObj.dims.dstInMile || (dimObj.stopOffs && dimObj.stopOffs.length > 1))
							&& accObj.dstConvRate) {
						distance = 0.0;
						if (dimObj.dims.dstInMile) {
							distance = dimObj.dims.dstInMile;
						} else {
							distance = this.getEffectiveDistance(dimObj);
						}
						totalAmt = accObj.amount * distance
								* accObj.dstConvRate;
					}

					if (accObj.basis == '/FLAT') {
						totalAmt = accObj.amount;
					}
					if (accObj.amount && accObj.basis == '/WM') {
						weight = dimObj.dims.wtInKG;
						volume = dimObj.dims.volInCBM;
						wmUnit = 0;
						if (weight) {
							wmUnit = weight * accObj.wtConvRate;
						}
						if (volume) {
							wmUnit = wmUnit > volume ? wmUnit : volume;
						}
						totalAmt = accObj.amount * wmUnit;
					}

					if (rateInputObj.baseRate.basis == accObj.basis
							&& !rateInputObj.baseRate.supportedBasis) {
						totalAmt = accObj.amount;
						accObj.supportedBasis = true;
					} else if (rateInputObj.baseRate.basis != accObj.basis
							&& !rateInputObj.baseRate.supportedBasis) {
						totalAmt = 0;
					}

					if (accObj.minAmount) {
						totalAmt = totalAmt < accObj.minAmount ? accObj.minAmount
								: totalAmt;
					}
					if (accObj.maxAmount) {
						totalAmt = totalAmt > accObj.maxAmount ? accObj.maxAmount
								: totalAmt;
					}

					if (!dimObj.dims.isHazMat && accObj.isHazMat) {
						totalAmt = 0;
					}

					if (accObj.basis == '/stop') {
						rateInputObj.stopOffTotal = parseFloat(totalAmt);
					} else {
						rateInputObj.accessorials[i].total = parseFloat(totalAmt);
					}
				}
			}
		}
	};

	this.getSurchargeAmount = function(dimObj, surcharge) {
		surchargeAmount = 0;
		inputObj = rateInputObj.baseRate;
		if (surcharge.basis === '/container') {
			if (inputObj.equipmentType && dimObj.dims[inputObj.equipmentType]) {
				surchargeAmount = surcharge.amount
						* dimObj.dims[inputObj.equipmentType];
			} else {
				return surchargeAmount;
			}
		}

		if (surcharge.basis === '/delivery' || surcharge.basis === '/entry'
				|| surcharge.basis === '/shipment') {
			surchargeAmount = surcharge.amount;
		}

		if (surcharge.basis === '/package' || surcharge.basis === '/pallet'
				|| surcharge.basis === '/unit' || surcharge.basis === '/carton'
				|| surcharge.basis === '/LNM' || surcharge.basis === '/SQM'
				|| surcharge.basis === '/MSF' || surcharge.basis === '/MBF'
				|| accObj.basis === '/LDM') {
			if (dimObj.dims.genericQty && dimObj.dims.genericQtyUnit
					&& (dimObj.dims.genericQtyUnit === surcharge.basis)) {
				surchargeAmount = surcharge.amount * dimObj.dims.genericQty;
			} else if (dimObj.dims[surcharge.basis]) {
				surchargeAmount = surcharge.amount
						* dimObj.dims[surcharge.basis];
			}
		}

		if (surcharge.amount && surcharge.basis == '/FLAT') {
			surchargeAmount = surcharge.amount;
		}

		if (dimObj.dims.wtInKG && surcharge.wtConvRate) {
			weight = dimObj.dims.wtInKG;
			// GTN-25018 : Chargeable Weight scenario.
			if (surcharge.calculatedWeightBasis
					&& surcharge.calculatedWeightBasis === 'Chargeable Weight') {
				dimFactor = rateInputObj.dimFactor;
				dimFactorConv = rateInputObj.dimFactorConv;
				volumetricWeight = 0.0;
				if (dimFactor > 0 && dimFactorConv && dimObj.dims.volInCBM) {
					if (dimFactorConv === 'cm/kg') {
						volumetricWeight = (dimObj.dims.volInCBM * 1000000)
								/ dimFactor;
					} else if (dimFactorConv === 'in/lb') {
						volumetricWeight = (dimObj.dims.volInCBM * 61024)
								/ dimFactor;
						volumetricWeight = volumetricWeight * 0.45359237;
					}
				}
				weight = (weight * surcharge.wtConvRate) > (volumetricWeight * surcharge.wtConvRate) ? weight
						: volumetricWeight;
			}
			if (surcharge.minWeight) {
				weight = weight < surcharge.minWeight ? surcharge.minWeight
						: weight;
			}
			surchargeAmount = surcharge.amount * weight * surcharge.wtConvRate;
		}

		if (dimObj.dims.volInCBM && surcharge.volConvRate) {
			volume = dimObj.dims.volInCBM;
			if (surcharge.minVolume) {
				volume = volume < surcharge.minVolume ? surcharge.minVolume
						: volume;
			}
			surchargeAmount = surcharge.amount * volume * surcharge.volConvRate;
		}

		if (surcharge.amount && surcharge.basis == '/WM') {
			weight = dimObj.dims.wtInKG;
			volume = dimObj.dims.volInCBM;
			wmUnit = 0;
			if (weight) {
				wmUnit = weight * surcharge.wtConvRate;
			}
			if (volume) {
				wmUnit = wmUnit > volume ? wmUnit : volume;
			}
			if (surcharge.minWeight) {
				wmUnit = wmUnit < surcharge.minWeight ? surcharge.minWeight
						: wmUnit;
				surcharge.wtConvRate = 1;
			}
			surchargeAmount = surcharge.amount * wmUnit;
		}

		if ((dimObj.dims.dstInMile || (dimObj.stopOffs && dimObj.stopOffs.length > 1))
				&& surcharge.dstConvRate) {
			if (surcharge.basis == '/stop') {
				surchargeAmount = surcharge.amount * dimObj.stopOffs.length
						* surcharge.dstConvRate;
			} else {
				distance = 0.0;
				if (dimObj.dims.dstInMile) {
					distance = dimObj.dims.dstInMile;
				} else {
					distance = this.getEffectiveDistance(dimObj);
				}
				surchargeAmount = surcharge.amount * distance
						* surcharge.dstConvRate;
			}
		}

		if (rateInputObj.baseRate.basis == inputObj.basis
				&& !rateInputObj.baseRate.supportedBasis) {
			surchargeAmount = surcharge.amount;
			surcharge.supportedBasis = true;
		} else if (rateInputObj.baseRate.basis != surcharge.basis
				&& !rateInputObj.baseRate.supportedBasis) {
			surchargeAmount = 0;
		}

		if (surcharge.minAmount) {
			surchargeAmount = surchargeAmount < surcharge.minAmount ? surcharge.minAmount
					: surchargeAmount;
		}
		if (surcharge.maxAmount) {
			surchargeAmount = surchargeAmount > surcharge.maxAmount ? surcharge.maxAmount
					: surchargeAmount;
		}
		return surchargeAmount;
	}

	this.evaluateStopOff = function(stopOffs) {
		stopOffAmt = 0.0;
		if (rateInputObj.stopBands && stopOffs && stopOffs.length > 2) {
			numOfStopOffs = stopOffs.length - 2;
			remainingStopOffs = numOfStopOffs;
			previousEnd = 0;

			for (i = 0; i < rateInputObj.stopBands.length; i++) {
				start = rateInputObj.stopBands[i].start;
				end = rateInputObj.stopBands[i].stop;
				if (numOfStopOffs > end) {
					stopOffAmt = stopOffAmt
							+ (rateInputObj.stopBands[i].costPerStop * (end - previousEnd));
					remainingStopOffs -= (end - previousEnd);
					previousEnd = end;

				} else if (numOfStopOffs >= start && numOfStopOffs <= end) {
					stopOffAmt = stopOffAmt
							+ (rateInputObj.stopBands[i].costPerStop * remainingStopOffs);
					break;
				}
			}
			rateInputObj.stopOffTotal = parseFloat(stopOffAmt);
		}

	};
